(function (){
	// menu private vars en functions..
	
	function GamePage()
	{
		this.resources=[
			//{data:{},type:"data",url:"tweak/ini.js"}
		];
	}
	/* init creates the elements on a page for the first time on first show!
	   we create ALL elements that we will use on the page, some may be hidden.
	*/
	GamePage.prototype.init=function()
	{
		this.initialised=true; //
		var dom=this.dom;
		
		this.canvas1=MG.lib.createCanvas("game_main_canvas1",this.w,this.h/2);
		dom.appendChild(this.canvas1); // take it out of the LIB, put it on the page, this does however mean it will not be REcreated.
		this.canvas2=MG.lib.createCanvas("game_main_canvas2",this.w,this.h/2);
		dom.appendChild(this.canvas2); // take it out of the LIB, put it on the page, this does however mean it will not be REcreated.

		
		// create the overlay hard for now.
		this.back=document.createElement("img");
		this.back.src="data:image/png;base64,";
		dom.appendChild(this.back); // take it out of the LIB, put it on the page, this does however mean it will not be REcreated.
			
		this.indicator=document.createElement("img");
		this.indicator.src="data:image/png;base64,";
		dom.appendChild(this.indicator); // take it out of the LIB, put it on the page, this does however mean it will not be REcreated.
		
//		this.back_canvas=MG.lib.createCanvas("game_back",MG.screen.w,MG.screen.h); // we create the game back
		// because on resize, we need to regenerate the game back
		// AND set the scale!

		
//		MG.trons.musitron.loadMusic("game","assets/sound/didu.wav");
//		MG.trons.musitron.loadMusic("win","assets/sound/win.wav");
//		MG.trons.musitron.loadMusic("lost","assets/sound/lost.wav");
//		MG.trons.musitron.loadMusic("rest","assets/sound/rest.wav");
		
	
		console.log("Game Dimensions: "+this.w,this.h);
		MG.game.viewport.setDimensions(this.w,this.h/2);
		MG.game.init(this);
		//MG.game.start();
		
	};
	/* resize takes the elements created by Init and resizes them.. duh..
	*/
	GamePage.prototype.resize=function()
	{
		this.canvas1.style.position="absolute";
		this.canvas1.style.left="0px";
		this.canvas1.style.top="0px";
		this.canvas2.style.position="absolute";
		this.canvas2.style.left="0px";
		this.canvas2.style.top=this.h/2+"px";
		
		this.back.style.position="absolute";
		this.back.style.left="0px";
		this.back.style.top="0px";
		this.back.style.width=this.w+"px";
		this.back.style.height=this.h+"px";

		this.indicator.style.position="absolute";
		this.indicator.style.left=(this.w-35)+"px";
		this.indicator.style.top=(this.h/2-35)+"px";
		this.indicator.style.width="70px";
		this.indicator.style.height="70px";
		MG.game.indicator_degrees=20;
		this.indicator.style.transform="rotate("+MG.game.indicator_degrees+"deg)";
		MG.game.indicator=this.indicator;
		
		
//		ctx.fillStyle="#60762e";
//		ctx.fillRect(14,7,MG.game.room.w,7);	
		
		if(MG.options.retro==true)
		{
			this.canvas1.style.imageRendering="optimizeSpeed"; // one of these will catch on a specific browser
			this.canvas1.style.imageRendering="-moz-crisp-edges"; // others will be ignored
			this.canvas1.style.imageRendering="-webkit-optimize-contrast"; // so it might seem
			this.canvas1.style.imageRendering="optimize-contrast"; // I'm setting one property 
			this.canvas1.style.imageRendering="pixelated"; // multiple times, but it's all one thing.
			this.canvas1.style.msInterpolationMode="nearest-neighbor"; // IE..
			this.canvas2.style.imageRendering="optimizeSpeed"; // one of these will catch on a specific browser
			this.canvas2.style.imageRendering="-moz-crisp-edges"; // others will be ignored
			this.canvas2.style.imageRendering="-webkit-optimize-contrast"; // so it might seem
			this.canvas2.style.imageRendering="optimize-contrast"; // I'm setting one property 
			this.canvas2.style.imageRendering="pixelated"; // multiple times, but it's all one thing.
			this.canvas2.style.msInterpolationMode="nearest-neighbor"; // IE..
		}
		this.canvas1.width=this.w;
		this.canvas1.height=this.h/2;
		this.canvas2.width=this.w;
		this.canvas2.height=this.h/2;
	};
	/* show created the elements on a page and shows IF it is the first time..
		It ALWAYS calls resize to do this pages particular layout..
	*/	
	GamePage.prototype.show=function()
	{
		var dom=this.dom;
		if(this.initialised!=true) this.init(); // we want the game to be initialised only ONCE!
		this.resize(); 
	};
	GamePage.prototype.showAchievement=function(text)
	{
		console.log("showAchievement: "+text);
		this.achievement.style.display="block";
		this.achievement.innerHTML="Achievement: "+text;
		// set a timeout to hide the achievement.
		window.setTimeout(this.hideAchievement.bind(this),3000);
	}
	GamePage.prototype.hideAchievement=function(text)
	{
		this.achievement.style.display="none";
	}
	GamePage.prototype.showPopup=function(which)
	{
		this.popup.style.display="block";
		var html="";
		switch(which)
		{
			case "lost":
				html+="<h1>Game Over<h1>";
			break;
			case "win":
			case "won":
				html+="<h1>MISSION COMPLETE<h1>";
			break;
			default:
				html+="<h1>Something happened! "+which+"<h1>";
			
		}
		this.popup.innerHTML=html;
	};

	MG.flow.addPage("game_page", new GamePage()); // it will only NOW by executed
	
})();
